import React from "react";
import web from "../src/images/Reliance1.png";
import { NavLink } from "react-router-dom";
import Commom from "./Commom";

const Home = () => {
  return (
    <>
      <Commom
        name="Jio Internship"
        imgsrc={web}
        visit="/service"
        btname="Get Started"
        // btname2="Get Started"
      />
    </>
  );
};

export default Home;
